css:
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);
@namespace hl url(http://www.w3.org/1999/xhtml);
/*http://kb.mozillazine.org/UserChrome.css_Element_Names/IDs*/
#forward-button[disabled="true"],/*hide disabled forward*/
#contentAreaContextMenu menuitem[disabled="true"],/*hide ALL disabled context menu items*/
#context-bookmarklink,#context-sendlink,#context-sendimage,#context-setDesktopBackground,#context-bookmarkpage,#context-sendpage
{display:none !important;}
/*Pretty about pages*/
@-moz-document url-prefix('about:'){hl|html,window{background:#D3DAED url('data:image/jpeg;base64,') no-repeat fixed center !important;}}
@-moz-document url('about:mozilla'){hl|html,hl|a{color:#000 !important;}}
@-moz-document url('about:blank'){hl|html{background:transparent !important;}}
@-moz-document url('about:newtab'){hl|div#newtab-scrollbox{background-color:transparent !important;}}
/*minimize feedhandler subscribe*/
hl|html#feedHandler hl|div#feedHeaderContainer{width:10% !important;max-height:4.5em !important;overflow:hidden !important;margin-bottom:-12px !important;transition:all .75s ease 0s !important;}hl|html#feedHandler hl|div#feedHeaderContainer:hover{width:100% !important;max-height:16em !important;margin-bottom:0 !important;}
